import React from 'react';
import { Grid, Image } from 'semantic-ui-react'

const _SearchMovieListDisplay = (props) => {
    return (
        <React.Fragment>
            <Grid >
                <Grid.Column >
                <div onClick={props.movieDetails}>
                        <Image inline src={props.movieImage} className="sizeOfContainerMovieImage" />
                </div>
                </Grid.Column>
            </Grid>
        </React.Fragment >
    )
}

export default _SearchMovieListDisplay;
